import React, { useState } from 'react';
import './LoginPage.css'
import { Link, userNavi } from 'react-router-dom';

export const SignupPage = () => {

	const history = useHistory();

	const handleSubmit = async (event) => {
	  event.preventDefault();
  
	  // Fetch or send form data to your server here using fetch or another method
	  // Example: Send a POST request to your server
	  const formData = new FormData(event.target);
	  const response = await fetch('/api/signup', {
		method: 'POST',
		body: formData,
	  });
  
	  // Handle the response as needed
	  if (response.ok) {
		// Redirect to a success page or perform other actions
		history.push('/success');
	  } else {
		// Handle errors
		console.error('Registration failed');
	  }
	};

  return (
    <div id='body_div'> 
        <div className="div_form">
			<div id="heading">
				<h1>Sign Up to IRCTC</h1>
			</div>
            <form onSubmit={handleSubmit} method='POST' id='LoginForm'>
					<inputGrp>
                    	<span>First Name</span><input type="text" placeholder='' name='FirstName' /> 
                    </inputGrp>

					<inputGrp>
                    	<span>Last Name</span><input type="text" placeholder='' name='LastName'/> 
                    </inputGrp>

                    <inputGrp>
                    	<span>Email ID</span><input type='email' placeholder='abc@gmail.com' name='Emailid' /> 
                    </inputGrp>

					<inputGrp>
                    	<span>Password</span><input type="Password" placeholder='Password' name='Password'/> 
                    </inputGrp>

					<inputGrp>
                    	<span>Birth Date</span><input type="Date" name='Birthdate' /> 
                    </inputGrp>
					
                    <inputGrp>
						<span>Gender</span>
						<select id="gender" name="Gender">
							<option value="Male">Male</option>
							<option value="Female">Female</option>
							<option value="Other">Other</option>
							<option value="NOTA">Prefer not to Say</option>
						</select>
                    </inputGrp>
					
					<inputGrp>
                    	<span id='address'>Address</span>
						
                    	<input type="text" placeholder='Street' name= 'address.street'/> 
                    	<input type="text" placeholder='City' name= 'address.city'/> 
                    	<input type="text" placeholder='State' name= 'address.state'/> 
                    	<input type="text" placeholder='Zip Code' name= 'address.zip'/> 
						
                    </inputGrp>
					
					<inputGrp>
						<button id='submit'>Register</button>
                    </inputGrp>
					
					<inputGrp>
           				Already have account?<Link to='/' id='page_link'> Login</Link>
          			</inputGrp>
            </form>
        </div>
    </div>
  )
}

export default SignupPage;
